import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import api from '../services/api';
import TenantLeaseCard from '../components/TenantLeaseCard';
import TenantPayments from '../components/TenantPayments';

export default function Profile({ user }) {
  const navigate = useNavigate();
  const userId = user?.user_id;
  const [lease, setLease] = useState(null);

  useEffect(() => {
    if (!userId) return;
    const token = localStorage.getItem('token');
    api.get(`/leases/user/${userId}`, { headers: { Authorization: `Bearer ${token}` } })
      .then(res => setLease(res.data))
      .catch(err => console.error("‚ùå Error loading lease:", err.response?.data || err.message));
  }, [userId]);

  if (!user) {
    return (
      <div style={styles.page}>
        <div style={styles.card}>
          <h2 style={styles.heading}>Tenant Profile</h2>
          <p style={styles.empty}>No user data found.</p>
          <button style={styles.backButton} onClick={() => navigate('/tenant')}>
            ‚Üê Back to Dashboard
          </button>
        </div>
      </div>
    );
  }

  const cards = [
    {
      title: 'Tenant Info',
      icon: 'üë§',
      content: (
        <>
          <p><strong>Name:</strong> {user.name || 'N/A'}</p>
          <p><strong>Email:</strong> {user.email || 'N/A'}</p>
          <p><strong>Role:</strong> {user.role || 'tenant'}</p>
        </>
      )
    },
    {
      title: 'Lease Info',
      icon: 'üìÑ',
      content: <TenantLeaseCard lease={lease} user={user} />
    },
    {
      title: 'Payment History',
      icon: 'üí≥',
      content: (
        <>
          <TenantPayments userId={userId} />
          {(user.role === 'tenant' || user.role === 'landlord') && (
            <button style={styles.button} onClick={() => navigate('/payments')}>
              Make a Payment
            </button>
          )}
        </>
      )
    }
  ];

  return (
    <div style={styles.page}>
      <div style={styles.grid}>
        {cards.map(c => (
          <div key={c.title} style={styles.card}>
            <div style={styles.cardHeader}>
              <span style={styles.icon}>{c.icon}</span>
              <h3 style={styles.cardTitle}>{c.title}</h3>
            </div>
            <div style={styles.cardContent}>{c.content}</div>
          </div>
        ))}
      </div>

      <button style={styles.backButton} onClick={() => navigate('/tenant')}>
        ‚Üê Back to Dashboard
      </button>
    </div>
  );
}

const styles = {
  page: {
    padding: '2rem',
    fontFamily: 'Segoe UI, sans-serif',
    background: 'linear-gradient(to bottom, #eef2f7, #f9fafb)',
    minHeight: '100vh',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  grid: {
    display: 'grid',
    gridTemplateColumns: 'repeat(auto-fit, minmax(280px, 1fr))',
    gap: '1.5rem',
    width: '100%',
    maxWidth: '1200px',
    marginBottom: '2rem'
  },
  card: {
    backgroundColor: '#fff',
    borderRadius: '16px',
    boxShadow: '0 6px 18px rgba(0,0,0,0.08)',
    padding: '1.5rem 2rem',
    transition: 'transform 0.2s ease, box-shadow 0.2s ease',
  },
  cardHeader: {
    display: 'flex',
    alignItems: 'center',
    gap: '0.75rem',
    marginBottom: '1rem',
  },
  icon: { fontSize: '2rem' },
  cardTitle: { fontSize: '1.4rem', color: '#1f2937', margin: 0 },
  cardContent: { marginTop: '0.5rem' },
  button: {
    marginTop: '1rem',
    padding: '0.7rem 1.4rem',
    background: '#1e3a8a',
    color: '#fff',
    border: 'none',
    borderRadius: '8px',
    fontWeight: 600,
    cursor: 'pointer',
    fontSize: '0.95rem',
    transition: 'all 0.2s ease',
  },
  backButton: {
    background: 'transparent',
    border: 'none',
    color: '#1e3a8a',
    cursor: 'pointer',
    fontSize: '1rem',
    textDecoration: 'underline',
    marginTop: '1rem'
  },
  empty: { color: '#6b7280', fontStyle: 'italic', marginBottom: '1rem' },
};
